class Human:    def __init__(self, name):        self.name = name    def see(self, obj):        print(self.name + " is seeing " + obj.food_name)        self.eat(obj)    def eat(self, obj):        print(self.name + " is eating " + obj.food_name)class Food:    def __init__(self, food_name):        self.food_name = food_nameMamarayim = Human("Mamarayim")Lavash = Food("Lavash")Mamarayim.see(Lavash)